  modal.setAttribute('class', 'modal-container hidden');
  document.querySelector(".smile-assessment form").appendChild(modal);
  console.log("adding modal");
  
  function getCookie(name) {
    var value = "; " + document.cookie;
    var parts = value.split("; " + name + "=");
    if (parts.length === 2) return parts.pop().split(";").shift();
  };
  
  //removing event listeners
  
  function ourCloseHandler (e) {
       
        if($('#sa-form').parsley().validate() && !modal.classList.contains("hidden")) {
          console.log("Submitting data anyways");
          console.log($('#sa-form').serialize());
          
          // Clear out phone and opt in
          $('#id_phone').val('');
          $('#sms_opt_in').prop('checked', false);
          
          // Commenting due to request
          //if($('#id_phone').val() == '' || !$('#id_phone').parsley().validate()) {
          //	$('#sms_opt_in').prop('checked', false);
          //}
          
          var httpRequest = new XMLHttpRequest();         
          
            var sadata = {
            country: getCookie('country_code'),
            locale: getCookie('django_language'),
            email: '',
            phoneNumber: '',
        		campaignSources: {utm_campaign: "smile_assesment"},
        		leadForms: {
              experiments: '',
              start_at: ''
            },
            dictionary: {
              lead_form_type: 'SA',
              SA_Why: '',
              SA_worn_braces: '',
              SA_biggest_concern: '',
              SA_crowding: '',
              SA_spacing: '',
              zip_code: '',
              accepts_sms_marketing: 'false'
            }
      		};
          
          $('#sa-form').serializeArray().forEach(function (element) {
            //myformData.append(element.name, element.value);
            //saobject[element.name] = element.value;
            if (element.name == 'email') {          		
          		sadata['email'] = element.value;
        		} else if(element.name == 'phone') {
              sadata['phoneNumber'] = element.value;
            } else {                            
              switch(element.name) {
    						case 'start_at':
      						sadata.leadForms.start_at = element.value;
      						break;
      					case 'why_straighten':
        					sadata.dictionary.SA_Why = element.value;
        					break;
                case 'worn_braces':
        					sadata.dictionary.SA_worn_braces = element.value;
        					break;
                case 'biggest_concern':
        					sadata.dictionary.SA_biggest_concern = element.value;
        					break;
                case 'crowding':
        					sadata.dictionary.SA_crowding = element.value;
        					break;
                case 'spacing':
        					sadata.dictionary.SA_spacing = element.value;
        					break;
                case 'postal_code':
        					sadata.dictionary.zip_code = element.value;
        					break;
      					default:
        					console.log('defualt not set' + element.name);
  						}
            }
            
            console.log("element-form", element.value);
          });

          console.log("SA1 V2 going to send post");
          console.log(sadata);
 				 	var jsonData = JSON.stringify(sadata);
	
          httpRequest.open('POST', 'https://leadsapi.smiledirectclub.com/api/leads');
      		httpRequest.setRequestHeader('X-Requested-With', 'XMLHttpRequest');
      		httpRequest.setRequestHeader('Content-Type', 'application/json');
      		httpRequest.send(jsonData);
          //navigator.sendBeacon('/api/leads/', myformData);
          console.log("SA1 V2 send post completed");
          
          //$('#sa-form').submit();
          //alert("Submitted: " + $('#sa-form').serialize());
        }
        e.preventDefault();
        e.returnValue = '';
       
        window.removeEventListener('beforeunload', ourCloseHandler);
      }

  // Disable the submit button as there will be no phone to begin with
