function runSDCLinkFixerOptimizely() {
  console.log('runSDCLinkFixerOptimizely');
	shophn=location.hostname;
  isShop = shophn.includes('shop.');
  console.log('isshop: ' + isShop);
  if (window.ENVIRONMENT !== 'prod' && !isShop) {
    console.log('NOT Prod - use runSDCLinkFixer');

    var arr = Array.prototype.slice.call(document.querySelectorAll('a'));
    for (var i = 0; i < arr.length; i++) {
      var elOrigin = arr[i].origin;
      var partialUrlMatch = /shop\.smiledirectclub\.|investors\.smiledirectclub\.|careers-smiledirectclub\.|\.pptx|\.icims|qa[0-6]\.smiledirectclub\.|staging.smiledirectclub\.|hotstage.smiledirectclub\./g;
      if (
        (window.location.origin != arr[i].origin) &&
        !partialUrlMatch.test(elOrigin) &&
        (elOrigin.includes('smiledirectclub') || elOrigin.includes('localhost') || elOrigin.includes('localsdc'))
        ) {
          var originalHref = arr[i].href;
          var newHref = originalHref.replace(arr[i].host, window.location.host);
          arr[i].href = newHref;
        }
      }
  } else {
    console.log('PROD environement - dont use runSDCLinkFixer');
  } 
}
